import navbar from '@/components/navbar'
import mapview from '@/components/map'
import mapkey from '@/components/mapKey'
import { mapActions } from 'vuex'

export default {
  name: 'App',
  components: {
    navbar,
    mapview,
    mapkey
  },
  created () {
    // Initialize Store
    this.loadAllFeatures().then(() => {
      this.loadAllBuildings()
    })
  },
  methods: {
    ...mapActions([
      'loadAllFeatures',
      'loadAllBuildings'
    ])
  }
}
